%[text] # 例題2.1（ネガポジ変換）
%[text] 村松正吾　「多次元信号・画像処理の基礎と展開」
%[text] 動作確認： MATLAB R2025b
%[text] ## 準備
isVerbose = false;
prj = matlab.project.currentProject;
prjroot = prj.RootFolder;
datfolder = fullfile(prjroot,"data");
resfolder = fullfile(prjroot,"results");
myfilename = "exercise02_01"; % mfilename

imgname = "msipimg04";
imgfmt = "tiff";
%%
%[text] ## 画像データの読込
imgfile = fullfile(datfolder,imgname);
X = im2double(rgb2gray(imread(imgfile,imgfmt)));
%%
%[text] ## 幾何処理前の画像表示
figure(1) %[output:64078bdf]
imshow(X)  %[output:64078bdf]
title('原画像')  %[output:64078bdf]
%%
%[text] ## ネガポジ変換
Y = -X+1; 
figure(2) %[output:3785ec24]
imshow(Y) %[output:3785ec24]
title('ネガ画像')  %[output:3785ec24]
%%
%[text] ## 結果出力
%imwrite(X,fullfile(resfolder,"fig02-01a.png"))
imwrite(Y,fullfile(resfolder,"fig02-01c.png"))
